&lt;p&gt;Two statements are followed by three conclusions numbered I, II and III. Assuming the statements to be true, even if they do not conform to real-world knowledge, decide which of the conclusion(s) logically follows from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;All ponds are pools.&lt;/p&gt;

&lt;p&gt;Some wells are ponds.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. Some ponds are not wells.&lt;/p&gt;

&lt;p&gt;II. Some wells are pools.&lt;/p&gt;
III. All pools are wells.

