&lt;p&gt;निम्नलिखित प्रश्न में दो कथन और उसके बाद I II और III से अंकित तीन निष्कर्ष दिए गये हैं। आपको दिए गये कथनों को सत्य मानना है, भले ही वे ज्ञात तथ्यों से भिन्न प्रतीत होते हों। सभी निष्कर्षों को पढ़िए और फिर निर्णय कीजिए कि दिये गये निष्कर्षों में से कौन सा/से निष्कर्ष कथनों का तार्किक रूप से अनुसरण करता है/हैं&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;सभी तालाब पूल हैं।&lt;/p&gt;

